<script>
    var customGraph2;
    function ghi() {
        // Fetching data for initialData1 (Liquid Limit)
        var initialData1 = [
            checkZero(parseFloat(document.getElementById('hcd_mc_1').value)),
            checkZero(parseFloat(document.getElementById('hcd_mc_2').value)),
            checkZero(parseFloat(document.getElementById('hcd_mc_3').value)),
            checkZero(parseFloat(document.getElementById('hcd_mc_4').value)),
            checkZero(parseFloat(document.getElementById('hcd_mc_5').value)),
            checkZero(parseFloat(document.getElementById('hcd_mc_6').value)),
            checkZero(parseFloat(document.getElementById('hcd_mc_7').value))
        ];

        // Fetching data for initialData2 (Moisture Content)
        var initialData2 = [
            checkZero(parseFloat(document.getElementById('hc_w1_1').value)),
            checkZero(parseFloat(document.getElementById('hc_w1_2').value)),
            checkZero(parseFloat(document.getElementById('hc_w1_3').value)),
            checkZero(parseFloat(document.getElementById('hc_w1_4').value)),
            checkZero(parseFloat(document.getElementById('hc_w1_5').value)),
            checkZero(parseFloat(document.getElementById('hc_w1_6').value)),
            checkZero(parseFloat(document.getElementById('hc_w1_7').value))
        ];

        var scatterCtx1  = document.getElementById('attChart').getContext('2d');
        if (customGraph2) {
            customGraph2.destroy();
        }

        // Define chart with two datasets (Liquid Limit and Moisture Content)
        customGraph2 = new Chart(scatterCtx1, {
            type: 'line',
            data: {
                labels: initialData1.map(String), // X-axis labels
                datasets: [{
                    label: 'Liquid Limit',
                    data: initialData1,
                    borderColor: 'rgba(75, 192, 192, 1)', // Custom color for Liquid Limit
                    backgroundColor: 'rgba(75, 192, 192, 0.2)', // Custom background color
                    borderWidth: 1
                }, {
                    label: 'Moisture Content',
                    data: initialData2,
                    borderColor: 'rgba(255, 99, 132, 1)', // Custom color for Moisture Content
                    backgroundColor: 'rgba(255, 99, 132, 0.2)', // Custom background color
                    borderWidth: 1
                }]
            },
            options: {
                scales: {
                    y: {
                        type: 'logarithmic',
                        title: {
                            display: true,
                            text: 'Y-axis (Logarithmic Scale)' // Customize y-axis label
                        },
                        suggestedMin: 1, // Set minimum to avoid zero issues
                        suggestedMax: 40 // Adjust max value as needed
                    },
                    x: {
                        type: 'logarithmic',
                        title: {
                            display: true,
                            text: 'X-axis (Logarithmic Scale)' // Customize x-axis label
                        },
                        suggestedMin: 1, // Set minimum to avoid zero issues
                        suggestedMax: 100 // Adjust max value as needed
                    },
                }
            }
        });

        // Function to check for zero and replace with a small positive value
        function checkZero(value) {
            return value > 0 ? value : 0.0001; // Avoid zero in log scale
        }

        // Function to update chart data
        function updateChart2() {
            var newData1 = [
                checkZero(parseFloat(document.getElementById('hc_w1_1').value)),
                checkZero(parseFloat(document.getElementById('hc_w1_2').value)),
                checkZero(parseFloat(document.getElementById('hc_w1_3').value)),
                checkZero(parseFloat(document.getElementById('hc_w1_4').value)),
                checkZero(parseFloat(document.getElementById('hc_w1_5').value)),
                checkZero(parseFloat(document.getElementById('hc_w1_6').value)),
                checkZero(parseFloat(document.getElementById('hc_w1_7').value))
            ];

            var newData2 = [
                checkZero(parseFloat(document.getElementById('hcd_mc_1').value)),
                checkZero(parseFloat(document.getElementById('hcd_mc_2').value)),
                checkZero(parseFloat(document.getElementById('hcd_mc_3').value)),
                checkZero(parseFloat(document.getElementById('hcd_mc_4').value)),
                checkZero(parseFloat(document.getElementById('hcd_mc_5').value)),
                checkZero(parseFloat(document.getElementById('hcd_mc_6').value)),
                checkZero(parseFloat(document.getElementById('hcd_mc_7').value))
            ];

            // Update chart labels and data
            customGraph2.data.datasets[0].data = newData1; // Update Liquid Limit data
            customGraph2.data.datasets[1].data = newData2; // Update Moisture Content data
            customGraph2.update();
        }

        // Add event listeners for updating chart on input change
        document.getElementById('hc_w1_1').addEventListener('change', updateChart2);
        document.getElementById('hc_w1_2').addEventListener('change', updateChart2);
        document.getElementById('hc_w1_3').addEventListener('change', updateChart2);
        document.getElementById('hc_w1_4').addEventListener('change', updateChart2);
        document.getElementById('hc_w1_5').addEventListener('change', updateChart2);
        document.getElementById('hc_w1_6').addEventListener('change', updateChart2);
        document.getElementById('hc_w1_7').addEventListener('change', updateChart2);
        document.getElementById('hcd_mc_1').addEventListener('change', updateChart2);
        document.getElementById('hcd_mc_2').addEventListener('change', updateChart2);
        document.getElementById('hcd_mc_3').addEventListener('change', updateChart2);
        document.getElementById('hcd_mc_4').addEventListener('change', updateChart2);
        document.getElementById('hcd_mc_5').addEventListener('change', updateChart2);
        document.getElementById('hcd_mc_6').addEventListener('change', updateChart2);
        document.getElementById('hcd_mc_7').addEventListener('change', updateChart2);
    }
