<script>
    var customGraph1;
    function def() {
        // Fetching data for initialData1 (Liquid Limit)
        var initialData1 = [
            parseFloat(document.getElementById('att_pen_1').value) || 0,
            parseFloat(document.getElementById('att_pen_2').value) || 0,
            parseFloat(document.getElementById('att_pen_3').value) || 0,
            parseFloat(document.getElementById('att_pen_4').value) || 0,
            parseFloat(document.getElementById('att_pen_5').value) || 0,
            parseFloat(document.getElementById('att_pen_6').value) || 0  // Added comma here
        ];

        // Fetching data for initialData2 (Moisture Content)
        var initialData2 = [
            parseFloat(document.getElementById('att_wc_1').value) || 0,
            parseFloat(document.getElementById('att_wc_2').value) || 0,
            parseFloat(document.getElementById('att_wc_3').value) || 0,
            parseFloat(document.getElementById('att_wc_4').value) || 0,
            parseFloat(document.getElementById('att_wc_5').value) || 0,
            parseFloat(document.getElementById('att_wc_6').value) || 0  // Added comma here
        ];

        var scatterCtx1  = document.getElementById('scatterChart').getContext('2d');
        if (customGraph1) {
            customGraph1.destroy();
        }
        // Define chart with two datasets (Liquid Limit and Moisture Content)
        customGraph1 = new Chart(scatterCtx1, {
            type: 'line',
            data: {
                labels: initialData1.map(String), // X-axis labels
                datasets: [{
                    label: 'Liquid Limit',
                    data: initialData1,
                    borderColor: 'rgba(75, 192, 192, 1)', // Custom color for Liquid Limit
                    backgroundColor: 'rgba(75, 192, 192, 0.2)', // Custom background color
                    borderWidth: 1
                }, {
                    label: 'Moisture Content',
                    data: initialData2,
                    borderColor: 'rgba(255, 99, 132, 1)', // Custom color for Moisture Content
                    backgroundColor: 'rgba(255, 99, 132, 0.2)', // Custom background color
                    borderWidth: 1
                }]
            },
            options: {
                scales: {
                    y: {
                        type: 'logarithmic',
                        title: {
                            display: true,
                            text: 'Y-axis (Logarithmic Scale)' // Customize y-axis label
                        },
                        suggestedMin: 1, // Set minimum to avoid zero issues
                        suggestedMax: 40 // Adjust max value as needed
                    },
                    x: {
                        type: 'logarithmic',
                        title: {
                            display: true,
                            text: 'X-axis (Logarithmic Scale)' // Customize x-axis label
                        },
                        suggestedMin: 1, // Set minimum to avoid zero issues
                        suggestedMax: 100 // Adjust max value as needed
                    },
                }
            }
        });

        // Function to check for zero and replace with a small positive value
        function checkZero(value) {
            return value > 0 ? value : 0.0001; // Avoid zero in log scale
        }

        // Function to update chart data
        function updateChart1() {
            var newData1 = [
                checkZero(parseFloat(document.getElementById('att_pen_1').value)),
                checkZero(parseFloat(document.getElementById('att_pen_2').value)),
                checkZero(parseFloat(document.getElementById('att_pen_3').value)),
                checkZero(parseFloat(document.getElementById('att_pen_4').value)),
                checkZero(parseFloat(document.getElementById('att_pen_5').value)),
                checkZero(parseFloat(document.getElementById('att_pen_6').value))  // Added comma here
            ];

            var newData2 = [
                checkZero(parseFloat(document.getElementById('att_wc_1').value)),
                checkZero(parseFloat(document.getElementById('att_wc_2').value)),
                checkZero(parseFloat(document.getElementById('att_wc_3').value)),
                checkZero(parseFloat(document.getElementById('att_wc_4').value)),
                checkZero(parseFloat(document.getElementById('att_wc_5').value)),
                checkZero(parseFloat(document.getElementById('att_wc_6').value))  // Added comma here
            ];

            // Update chart labels and data
            customGraph1.data.datasets[0].data = newData1; // Update Liquid Limit data
            customGraph1.data.datasets[1].data = newData2; // Update Moisture Content data
            customGraph1.update();
        }

        // Add event listeners for updating chart on input change
        document.getElementById('att_pen_1').addEventListener('change', updateChart1);
        document.getElementById('att_pen_2').addEventListener('change', updateChart1);
        document.getElementById('att_pen_3').addEventListener('change', updateChart1);
        document.getElementById('att_pen_4').addEventListener('change', updateChart1);
        document.getElementById('att_pen_5').addEventListener('change', updateChart1);
        document.getElementById('att_pen_6').addEventListener('change', updateChart1);
        document.getElementById('att_wc_1').addEventListener('change', updateChart1);
        document.getElementById('att_wc_2').addEventListener('change', updateChart1);
        document.getElementById('att_wc_3').addEventListener('change', updateChart1);
        document.getElementById('att_wc_4').addEventListener('change', updateChart1);
        document.getElementById('att_wc_5').addEventListener('change', updateChart1);
        document.getElementById('att_wc_6').addEventListener('change', updateChart1);
    }
</script>

	
