	$('#att_pen_1,#att_pen_2,#att_pen_3,#att_pen_4,#att_pen_5,#att_pen_6, \
#att_con_1,#att_con_2,#att_con_3,#att_con_4,#att_con_5,#att_con_6,#att_con_7,#att_con_8,#att_con_9, \
#att_w1_1,#att_w1_2,#att_w1_3,#att_w1_4,#att_w1_5,#att_w1_6,#att_w1_7,#att_w1_8,#att_w1_9, \
#att_w2_1,#att_w2_2,#att_w2_3,#att_w2_4,#att_w2_5,#att_w2_6,#att_w2_7,#att_w2_8,#att_w2_9, \
#att_w3_1,#att_w3_2,#att_w3_3,#att_w3_4,#att_w3_5,#att_w3_6,#att_w3_7,#att_w3_8,#att_w3_9') 
.change(function () {

    // First calculate WC values from W1/W2/W3
    for (let i = 1; i <= 9; i++) {
        const w1 = parseFloat($('#att_w1_' + i).val());
        const w2 = parseFloat($('#att_w2_' + i).val());
        const w3 = parseFloat($('#att_w3_' + i).val());

        if (!isNaN(w1) && !isNaN(w2) && !isNaN(w3) && (w3 - w1) !== 0) {
            const wc = ((w2 - w3) / (w3 - w1)) * 100;
            $('#att_wc_' + i).val(wc.toFixed(2));
        } else {
            $('#att_wc_' + i).val('');
        }
    }

    // Now calculate average of att_wc_1 to att_wc_6 for LL
    let ll_total = 0, ll_count = 0;
    for (let i = 1; i <= 6; i++) {
        const wc = parseFloat($('#att_wc_' + i).val());
        if (!isNaN(wc)) {
            ll_total += wc;
            ll_count++;
        }
    }

    // Calculate average of att_wc_7 to att_wc_9 for PL
    let pl_total = 0, pl_count = 0;
    for (let i = 7; i <= 9; i++) {
        const wc = parseFloat($('#att_wc_' + i).val());
        if (!isNaN(wc)) {
            pl_total += wc;
            pl_count++;
        }
    }

    const att_ll = ll_count ? (ll_total / ll_count) : 0;
    const att_pl = pl_count ? (pl_total / pl_count) : 0;
    const att_pi = att_ll - att_pl;

    $('#att_ll').val(att_ll.toFixed(2));
    $('#att_pl').val(att_pl.toFixed(2));
    $('#att_pi').val(att_pi.toFixed(2));

    def();
});
	
