			}
			else
			{
				var g_3 = $('#g3').val();
				var g_4 = $('#g4').val();
				
				var R22 = (+g_3) + (+g_4);
			}			
			
			
			var R18 = $('#g1').val();
			var R19 = $('#g2').val();
			var R23 = $('#a1').val();
			var R25 = $('#a3').val();
			
			
			if(R22<=50 && R19>=R19 && R25=="NP")
			{
				$('#so1').val("GM");
			}
			else
			{
				if(R22<=50 && R18>=R19 && R25!="NP" && R25>0)
				{
					$('#so1').val("GC");
				}
				else
				{
					if(R22<=50 && R19>R18 && R25=="NP")
					{
						$('#so1').val("SM");		
