	$('#shr_sdn1,#shr_sdn2,#shr_sdn3,#shr_esd1,#shr_esd2,#shr_esd3,#shr_esd4,#shr_esd5,#shr_esd6,#shr_esd7,#shr_esd8,#shr_esd9').change(function () {
	function calcWA(sdn, esdA, esdB, esdC) {
		sdn = parseFloat(sdn);
		esdA = parseFloat(esdA);
		esdB = parseFloat(esdB);
		esdC = parseFloat(esdC);

		if (!isNaN(sdn) && !isNaN(esdA) && !isNaN(esdB) && !isNaN(esdC) && esdC !== 0) {
			return (sdn - (((esdA - esdB) / esdC) * 100));
		}
		return '';
	}

	let wa1 = calcWA($('#shr_sdn1').val(), $('#shr_esd1').val(), $('#shr_esd4').val(), $('#shr_esd7').val());
	let wa2 = calcWA($('#shr_sdn2').val(), $('#shr_esd2').val(), $('#shr_esd5').val(), $('#shr_esd8').val());
	let wa3 = calcWA($('#shr_sdn3').val(), $('#shr_esd3').val(), $('#shr_esd6').val(), $('#shr_esd9').val());

	$('#shr_wa1').val(wa1 !== '' ? wa1.toFixed(2) : '');
	$('#shr_wa2').val(wa2 !== '' ? wa2.toFixed(2) : '');
	$('#shr_wa3').val(wa3 !== '' ? wa3.toFixed(2) : '');

	// Calculate average only if at least one WA is valid
	let waValues = [wa1, wa2, wa3].filter(v => v !== '');
	if (waValues.length > 0) {
		let avg = waValues.reduce((a, b) => a + b, 0) / waValues.length;
		$('#shr_asl').val(avg.toFixed(2));
	} else {
		$('#shr_asl').val('');
	}
});

	
