	$('#sg,#ps,#vs,#is_si,#rtemp,#wtemp,#pykn1,#pykn2,#mpykn1,#mpykn2,#mpykn_ds1,#mpykn_ds2,#mpykn_sw1,#mpykn_sw2,#mpykn_fw1,#mpykn_fw2,#sgrt1,#sgrt2,#rdwroom1,#rdwroom2,#rdw27c_1,#rdw27c_2,#k_1,#k_2,#csg_1,#csg_2,#asg_1').change(function() {
    // Get all inputs
    const getVal = (id) => parseFloat($('#' + id).val()) || 0;

    let sgrt1 = 0, sgrt2 = 0;
    if (getVal('mpykn1') && getVal('mpykn_ds1') && getVal('mpykn_fw1') && getVal('mpykn_sw1')) {
        let den1 = (getVal('mpykn_fw1') - getVal('mpykn1')) - (getVal('mpykn_sw1') - getVal('mpykn_ds1'));
        if (den1 !== 0) {
            sgrt1 = (getVal('mpykn_ds1') - getVal('mpykn1')) / den1;
            $('#sgrt1').val(sgrt1.toFixed(2));
        } else {
            $('#sgrt1').val('');
        }
    }

    if (getVal('mpykn2') && getVal('mpykn_ds2') && getVal('mpykn_fw2') && getVal('mpykn_sw2')) {
        let den2 = (getVal('mpykn_fw2') - getVal('mpykn2')) - (getVal('mpykn_sw2') - getVal('mpykn_ds2'));
        if (den2 !== 0) {
            sgrt2 = (getVal('mpykn_ds2') - getVal('mpykn2')) / den2;
            $('#sgrt2').val(sgrt2.toFixed(2));
        } else {
            $('#sgrt2').val('');
        }
    }

    let k_1 = 0, k_2 = 0;
    if (getVal('rdwroom1') && getVal('rdw27c_1')) {
        k_1 = getVal('rdwroom1') / getVal('rdw27c_1');
        $('#k_1').val(k_1.toFixed(2));
    } else {
        $('#k_1').val('');
    }

    if (getVal('rdwroom2') && getVal('rdw27c_2')) {
        k_2 = getVal('rdwroom2') / getVal('rdw27c_2');
        $('#k_2').val(k_2.toFixed(2));
    } else {
        $('#k_2').val('');
    }

    let csg_1 = 0, csg_2 = 0;
    if (k_1 && sgrt1) {
        csg_1 = k_1 * sgrt1;
        $('#csg_1').val(csg_1.toFixed(2));
    } else {
        $('#csg_1').val('');
    }

    if (k_2 && sgrt2) {
        csg_2 = k_2 * sgrt2;
        $('#csg_2').val(csg_2.toFixed(2));
    } else {
        $('#csg_2').val('');
    }

    // Average only if value exists
    let values = [];
    if (csg_1) values.push(csg_1);
    if (csg_2) values.push(csg_2);

    if (values.length > 0) {
        let avg = values.reduce((a, b) => a + b, 0) / values.length;
        $('#asg_1').val(avg.toFixed(2));
    } else {
        $('#asg_1').val('');
    }
});
	
	
	
